(36, 63, 'BPI', 'CHIPMUNCH COMPANY INC', '0381-0161-96', 1, 3, 1, 1, 'Hi <firstname>! Your Taters Snack Shop System Order tracking number is <tracking>. You may upload your payment from our order-view portal. See link here: https://ilovetaters.com/shop/order-view/. You may also use our order-view portal to check the status of your order anytime. Please be advised that delivery usually takes 1 to 2 working days upon uploading of payment screenshot. Thank you and stay safe.', 'Hi <firstname>! Your Taters Snack Shop System Order tracking number is <tracking>. You may upload your payment from our order-view portal. See link here: https://ilovetaters.com/shop/order-view/. You may also use our order-view portal to check the status of your order anytime. Please be advised that delivery usually takes 1 to 2 working days upon uploading of payment screenshot. Thank you and stay safe.', 'Thank your for ordering from the Taters Snack Shop. An SMS/text notification will be sent to you now for additional instructions, including where you can upload the screenshot for your bank payment. Please watch out for it. \r\n\r\nOur Taters representative will call you once your order is ready for pick-up and/or delivery. Thank you, and stay safe!', 'Thank your for ordering from the Taters Snack Shop.<next>An SMS/text notification will be sent to you now for additional instructions, including where you can upload the screenshot for your bank payment.<next>Please watch out for it. Our Taters representative will call you once your order is ready for pick-up and/or delivery.<next>Thank you, and stay safe!', ''),
