(1, 'Popcorn_Catering_Taters_1.jpg', 'MINI POP & CRUNCH PACKAGE', 'Hot & freshly cooked large cut potato crisps', '<li>Delivery and/or Pick-up of items are from Monday to Sunday (except holidays) between 11AM to 7PM</li>\r\n<li>Delivery and/or Pick-up of product would be on the same day if paid before 4:00 pm</li>\r\n<li>You will be charged with a delivery fee depending on your location</li>\r\n<li>Our stores will reach out to you via SMS once orders are ready for delivery/pick-up</li>', 125, 'BUNDLE', 'Make Celebrations Munch Better with Taters!\r\n</br>\r\n</br>\r\nENJOY BIGGER SAVINGS FOR BIGGER CELEBRATIONS.\r\n</br>&#8226; Less than 50 guests: P125 per head\r\n</br>&#8226; 51 to 99 guests: P120 per head\r\n</br>&#8226; More than 100 guests: P110 per head\r\n</br>\r\n</br>\r\nEach guest will receive the ff: \r\n</br>&#8226; 1pc Mini Pack Superpop\r\n</br>&#8226; 1pc Mini Pack Tortilla Chips\r\n</br>\r\n</br>\r\nWe offer a FREE branded set-up for a standard minimum consumable package price of P10,000 for a table set-up (save P500) and P15,000 for a cart set-up (save P2,500)', 1, 1, 5, 1, 'f0efd98bd2c17ac4e81c', NULL, '', '0000-00-00 00:00:00', '0000', 1, NULL, 0),
